import { atom } from "recoil";
import { TodoItem } from "../models/todo.model";

export const todoListState = atom<TodoItem[]>({
  key: "todoListState",
  default: [{ id: "dfsdfdsfdsfd", label: "string", isCompleted: false }],
});
